function QuickLinkCard() {
    return (
        <>
            <a href="#">
                <div className="quicklinkcard">
                    <p><i className="bi bi-book" /></p>
                    <h4>Learning</h4>
                    <h2>An essential guide to workspace</h2>
                </div>
            </a>
        </>
    )
};

export default QuickLinkCard;
